    /**
     * Returns a CategoryLanguageValue with the given value. For a specific value the 
     * returned object will always be a singleton so reference equality 
     * is satisfied when the values are the same.
     * 
     * @param value value to be wrapped as CategoryLanguageValue
     */ 
    public static CategoryLanguageValue of(String value) {
        synchronized (CategoryLanguageValue.class) {
            return values.computeIfAbsent(value, v -> new CategoryLanguageValue(v));
        }
    }

