    public boolean equals(java.lang.Object obj) {
        if (this == obj)
            return true;
        if (obj == null)
            return false;
        if (getClass() != obj.getClass())
            return false;
        CategoryLanguageValue other = (CategoryLanguageValue) obj;
        return Objects.equals(value, other.value);
    }

